import 'card.dart';
import 'link.dart';

class PaymentMethodOptions {
  Card? card;
  Link? link;

  PaymentMethodOptions({this.card, this.link});

  factory PaymentMethodOptions.(
      Map<String, dynamic> json) {
    return PaymentMethodOptions(
      card: json['card'] == null
          ? null
          : Card
              .(
                  json['card'] as Map<String, dynamic>),
      link: json['link'] == null
          ? null
          : Link
              .(
                  json['link'] as Map<String, dynamic>),
    );
  }

  Map<String, dynamic>
      () {
    return {
      'card': card
          ?.(),
      'link': link
          ?.(),
    };
  }
}
